41d641f0-2dcc-4f1c-bf40-e8a61fc1dbc7	0063df6b-730e-4696-aac1-d812b1ada540	This is a Technology License and Royalty Agreement between Advanced Materials Technology Corp. (Licensor) and Precision Industrial Solutions Inc. (Licensee). The agreement grants Licensee exclusive manufacturing rights to use, manufacture, and distribute products incorporating patented technologies. The agreement has a 10-year initial term with automatic renewal for successive 5-year periods.	{"terms": [{"type": "Royalty Structure", "location": "Section 3.1", "confidence": 0.95, "description": "Licensee pays royalties based on Net Sales of Licensed Products according to a tiered structure. For automotive components, the royalty rate ranges from 6.5% to 4.8% depending on Net Sales Volume. For industrial and aerospace components, the royalty rate is 7.2% for standard applications, 8.5% for aerospace/high-performance applications, and 9.8% for custom engineering projects."}, {"type": "Payment Terms", "location": "Section 6.2", "confidence": 0.9, "description": "Licensee must pay royalties within 30 days of submitting quarterly royalty reports. Late payments are subject to a 1.5% monthly service charge."}, {"type": "Manufacturing Requirements", "location": "Section 5.1 and 5.2", "confidence": 0.88, "description": "Licensee must manufacture Licensed Products in accordance with Licensor's specifications and quality standards, including ISO 9001:2015 and TS 16949 automotive quality certifications. Licensee must also meet production volume commitments, with a minimum of 50,000 units annually in Years 1-2, 125,000 units annually in Years 3-5, and 200,000 units annually or market penetration targets in Years 6+."}, {"type": "Licensed Technology", "location": "Section 1.1", "confidence": 0.85, "description": "Licensor grants Licensee the rights to use, manufacture, and distribute products incorporating patented technologies, including US Patent 11,247,839, US Patent 11,089,472, US Patent 10,958,364, and International PCT/US2022/015847."}, {"type": "Termination and Post-Termination", "location": "Section 9.1 and 9.2", "confidence": 0.8, "description": "The agreement can be terminated upon 90 days written notice for material breach. Upon termination, Licensee may continue selling existing inventory for 12 months, subject to continued royalty payments and reporting obligations."}, {"type": "Financial Obligations", "location": "Section 4.1 and 4.2", "confidence": 0.85, "description": "Licensee must pay a one-time license fee of $850,000 within 30 days of agreement execution, and an additional $275,000 for comprehensive technology transfer. Licensee must also pay royalties based on Net Sales of Licensed Products."}, {"type": "Performance Requirements", "location": "Section 5.2 and 6.2", "confidence": 0.8, "description": "Licensee must meet production volume commitments and quality standards. Licensee must also pay royalties within 30 days of submitting quarterly royalty reports."}, {"type": "Territory and Scope", "location": "Section 2.2", "confidence": 0.85, "description": "The agreement grants Licensee exclusive manufacturing rights within the United States, Canada, and Mexico for manufacturing operations, and distribution rights extend to all of North and South America."}], "currency": "USD", "licensee": "Precision Industrial Solutions Inc.", "licensor": "Advanced Materials Technology Corp.", "paymentTerms": "Royalties based on Net Sales of Licensed Products", "effectiveDate": "January 8, 2024", "expirationDate": "January 8, 2034"}	[{"level": "high", "title": "Non-Compliance with Manufacturing Requirements", "description": "If Licensee fails to meet manufacturing requirements, Licensor may terminate the agreement, resulting in significant financial losses for Licensee."}, {"level": "medium", "title": "Royalty Rate Disputes", "description": "If Licensee disputes the royalty rate, it may lead to delays in payment and potential litigation."}, {"level": "low", "title": "